import { LoginComponentStyled, LoginFields } from './LoginComponent.styled';

const LoginComponent = () => {
	return (
		<LoginComponentStyled>
			<LoginFields>
				<h1>login</h1>
				<input placeholder='Username/email' />
				<input placeholder='Password' />
			</LoginFields>
		</LoginComponentStyled>
	);
};

export default LoginComponent;
